import React from "react";
import PropTypes from "prop-types";
import { Navbar, NavbarBrand } from "shards-react";

import { Dispatcher, Constants } from "../../../flux";

class SidebarMainNavbar extends React.Component {
	constructor(props) {
		super(props);

		this.handleToggleSidebar = this.handleToggleSidebar.bind(this);
	}

	handleToggleSidebar() {
		Dispatcher.dispatch({ actionType: Constants.TOGGLE_SIDEBAR });
	}

	render() {
		const { hideLogoText } = this.props;
		return (
			<div className="main-navbar">
				<Navbar className="align-items-stretch flex-md-nowrap p-0" >
					<NavbarBrand href="#" className="w-100 mr-0" style={{ lineHeight: "40px" }} >
						<div className="d-table m-auto">
							<img
								id="main-logo"
								className="d-inline-block align-top mr-1"
								style={{ maxWidth: "40px" }}
								src={require("../../../images/shards-dashboards-logo.svg")}
								title="Nome da Empresa"
								alt={"Logo da Empresa"}
							/>
							{!hideLogoText && (
								<span className="d-none d-md-inline ml-1">Nome da Empresa</span>
							)}
						</div>
					</NavbarBrand>
					{/* eslint-disable-next-line */}
					<a className="toggle-sidebar d-sm-inline d-md-none d-lg-none" onClick={this.handleToggleSidebar} >
						<i className="material-icons">&#xE5C4;</i>
					</a>
				</Navbar>
			</div>
		);
	}
}

SidebarMainNavbar.propTypes = {
	/**
	 * Whether to hide the logo text, or not.
	 */
	hideLogoText: PropTypes.bool
};

SidebarMainNavbar.defaultProps = {
	hideLogoText: false
};

export default SidebarMainNavbar;
